	//missing data:
	//altogether: metric_object will be null -- no data for metric -- for all geolevelss
	//no valid data for selected geolevel -- summary will be null, lookup will return null or empty array
	//no valid data for a place - get(geo) will return null

	//metric is one of ["change","start","end"]
	function lookup(indicator, metric, geolevel){
	    var metric_object = all_data[indicator].vars[metric];
	    var all = [];
	    var d = {
	        color_scale: function(d){return "#e0e0e0"}
	    };
	    d.defs = {label:all_data[indicator].label[0], definition:all_data[indicator].definition[0], source:all_data[indicator].source[0]};

	    try{
	        if(metric_object == null){throw new Error("No data")}

	        d.summary = metric_object.summary[geolevel];
	        d.invalid_metric = false;
	        d.hl = metric_object.summary.heartland;
	        d.nhl = metric_object.summary.non_heartland;
	        d.label = metric_object.label;
	        d.period = metric_object.period;
	        d.format = metric_object.format;
	        d.formatAxis = metric_object.formatAxis;
	        d.get = function(g){
	            g = g+"";
	            var r;
	            if(arguments.length > 0){
	                try{
	                    var d = metric_object.lookup[geolevel];
	                    r = d[g] == null ? null : d[g];
	                }
	                catch(e){
	                    r = null;
	                    console.warn("Data not available");
	                }
	            }
	            else{
	                r = all.slice(0);
	            }
	            return r;
	        };

	    }
	    catch(e){
	        d.summary = null;
	        d.invalid_metric = true;
	        d.get = function(g){
	            return arguments.length > 0 ? null : [];
	        };
	        d.formatAxis = null;
	        d.format = null;
	    }

	    var universe = 0;
	    var missings = 0;
	    console.log("+++++++++++");
	    console.log(indicator);

	    //use summary to populate "all" array and to build color scales
	    try{
	        if(d.summary != null){
	            var data = metric_object.lookup[geolevel];
	            for(var g in data){
	                if(data.hasOwnProperty(g)){
	                    if(data[g] != null){
	                        all.push({value:data[g], geo:g});
	                    }
	                    else{
	                        missings++;
	                    }
	                }
	                universe++;
	            }

	        
	            //color scales

	            var plus3 = d.summary.mean + 3*d.summary.sd;
	            var minus3 = d.summary.mean - 3*d.summary.sd;

	            var sliced = all.slice(0).filter(function(d){
	                return d.value <= plus3 && d.value >= minus3;
	            });

	            var min = d3.min(sliced, function(d){return d.value});
	            var max = d3.max(sliced, function(d){return d.value});

	            //var min = d.summary.min;
	            //var max = d.summary.max;

	            //whether diverging must be determined based on actual min/max, not trimmed min/max (see change in poverty at state level)
	            if(d.summary.min < 0 && d.summary.max > 0){
	                var maxabs = Math.max(Math.abs(min), max);

	                var blues = geolevel=="state" || geolevel=="rural" ? palette.blues4 : palette.blues4;
	                var reds = geolevel=="state" || geolevel=="rural" ? palette.reds4 : palette.reds4;

	                var blue_scale = d3.scaleQuantize().domain([0, maxabs]).range(blues);
	                var red_scale = d3.scaleQuantize().domain([0, maxabs]).range(reds);
	                d.color_scale = function(v){
	                    if(v==null){
	                        return palette.na;
	                    }
	                    else if(v < 0){
	                        return red_scale(Math.abs(v));
	                    }
	                    else{
	                        return blue_scale(v);
	                    }
	                };
	            }
	            else if(d.summary.min >= 0){

	                var blues = geolevel=="state" || geolevel=="rural" ? palette.blues4 : palette.blues6;

	                var blue_scale = d3.scaleQuantize().domain([min, max]).range(blues);
	                d.color_scale = function(v){
	                    return v==null ? palette.na : blue_scale(v);
	                };
	            }
	            else{

	                var reds = geolevel=="state" || geolevel=="rural" ? palette.reds4 : palette.reds6;

	                var red_scale = d3.scaleQuantize().domain([max, min]).range(reds);
	                d.color_scale = function(v){
	                    return v==null ? palette.na : red_scale(v);
	                };
	            }

	        }
	        else{
	            console.log("summary is null, lookup for geolevel is " + metric_object.lookup[geolevel]);
	        }
	    }
	    catch(e){
	        console.log(e);
	        all = [];
	        d.color_scale = function(d){return "#e0e0e0"};
	    }

	    console.log("universe size: " + universe + " | valid data for: " + all.length + " | missings: " + missings);
	    console.log("..........");

	    return d;
	}

	//v1.0 developed for congressional district poverty, gig economy, and gci summit

	var format = {};


	format.rank = function(r){
		try{
		    if(r == null){
		        throw "badInput";
		    }
		    else{
		        
		        var c = r + "";
		        var f = +(c.substring(c.length-1)); //take last letter and coerce to an integer
		         
		        var e = ["th","st","nd","rd","th","th","th","th","th","th"];
		 
		        var m = (+r)%100; 
		        var r_ = (m>10 && m<20) ? c + "th" : (c + e[f]); //exceptions: X11th, X12th, X13th, X14th
		    }
		}
		catch(e){
		    var r_ = "N/A";
		}

		return r_; 
	};

	format.ranker = function(values, ascending){
		if(arguments.length > 1 && !!ascending){
			var vals = values.slice(0).sort(function(a,b){
				if(a==b){
					return 0;
				}
				else if(a==null){
					return 1;
				}
				else if(b==null){
					return -1;
				}
				else{
					return a-b;
				}
			});
		}
		else{
			var vals = values.slice(0).sort(function(a,b){
				if(a==b){
					return 0;
				}
				else if(a==null){
					return 1;
				}
				else if(b==null){
					return -1;
				}
				else{
					return b-a;
				}
			});
		}

		var fn = function(v){
			//null or undefined get null rank
			return v==null ? null : vals.indexOf(v)+1;
		};
		fn.n = function(){return vals.length};
		return fn;  
	};

	//percent change
	format.pct0 = d3.format("+,.0%");
	format.pct1 = d3.format("+,.1%");

	//abs change
	format.ch0 = d3.format("+,.0f");
	format.ch1 = d3.format("+,.1f");

	//shares
	format.sh0 = d3.format(",.0%");
	format.sh1 = d3.format(",.1%");

	//share change
	format.shch0 = function(v){return format.ch0(v*100)+" pts"};
	format.shch1 = function(v){return format.ch1(v*100)+" pts"};

	//numeric
	format.num0 = d3.format(",.0f");
	format.num1 = d3.format(",.1f");
	format.num2 = d3.format(",.2f");
	format.num3 = d3.format(",.3f");

	//rounded to nearest 000s
	format.ths0 = function(v){return format.num0(v/1000)};
	format.ths1 = function(v){return format.num1(v/1000)};

	//USD
	format.doll0 = function(v){return "$" + format.num0(v)};
	format.doll1 = function(v){return "$" + format.num1(v)};
	format.doll2 = function(v){return "$" + format.num2(v)};
	format.doll000 = function(v){return "$" + format.num0(v/1000)};

	format.dolle30 = function(v){return "$" + format.num0(v*1000)};

	format.dollch0 = function(v){return v < 0 ? "-$" + format.num0(-1*v) : "+$" + format.num0(v)};
	format.dollch1 = function(v){return v < 0 ? "-$" + format.num1(-1*v) : "+$" + format.num1(v)};
	format.dollch2 = function(v){return v < 0 ? "-$" + format.num2(-1*v) : "+$" + format.num2(v)};

	//id
	format.id = function(v){return v};

	//possessive
	format.possessive = function(v){
		var s = v+"";
		var last = s.slice(-1).toLowerCase();
		return last=="s" ? s+"'" : s+"'s";
	};

	//wrapper that handles missings/nulls
	format.fn = function(v, fmt){
		if(format.hasOwnProperty(fmt)){
			var fn = format[fmt];
		}
		else{
			var fn = format.id;
		}
		return v==null ? "N/A" : fn(v);
	};

	//similar to fn above, but returns a decorated function instead of a value
	format.fn0 = function(fmt){
		if(fmt!==null && format.hasOwnProperty(fmt)){
			var fn = format[fmt];
		}
		else{
			var fn = format.id;
		}
		return function(v){
			return v==null ? "N/A" : fn(v);
		}
	};

